import React from "react";
import "./App.css";
import Header from "./Header";
import CardHospedagem from "./CardHospedagem";
import Footer from "./Footer";

function App() {
  return (
    <div className="App">
      <Header />
      <h1 style={{ padding: "1rem" }}>Hospedagens</h1>
      <CardHospedagem style={{ padding: "1rem" }}/>
      <CardHospedagem />
      <Footer />
    </div>
  );
}

export default App;
